import React from 'react';
import Media from './media';

const Component = ({course}) =>{
  return(
         <div> 
            <h4> {course.title} </h4>
            <div>
            <small className="text-muted text-italic"><i className="fas fa-clock"></i> {course.createdAt} </small>
            <strong className="text-italic"><i className="fas fa-user"></i> "Imad Najmi" </strong>
            </div>
            <Media isVideo={course.is_video}
                title={course.slug} 
                media={course.media}
                width={400}
                height={300}
            />
            <div className="card"> {course.description} </div>
            <div className="bg-light card"> {course.objectifs} </div>
        </div>
    )
}


export default Component;
